import React, {useState} from 'react';
import ReactCard from './MainCard.js';
import ReportsCard from './ReportsCard.js';
import 'bootstrap/dist/css/bootstrap.min.css';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab';
import Container from 'react-bootstrap/Container';
import Card from 'react-bootstrap/Card';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
import '../App.css';


function Extract (){
  
  const [key, setKey] = useState('workflow');

  return(
    <>
      <Container className="mt-5 mb-5">
        <Tabs id="controlled-tab-example" activeKey={key} onSelect={k => setKey(k)}>
          <Tab eventKey="workflow" title="Workflow">
            <Card className="border-top-0 border border-rad-0">
              <Card.Body>
                <ReactCard />
              </Card.Body>
            </Card>
          </Tab>
          <Tab eventKey="report" title="Report">
            <Card className="border-top-0 border border-rad-0">
              <Card.Body>
                <ReportsCard />
              </Card.Body>
            </Card>
          </Tab>
        </Tabs>
        <Card>
        <Card.Header>
          <Nav variant="tabs" defaultActiveKey="#workflow">
            <Nav.Item>
              <Nav.Link key="workflow" component={ReactCard}>Workflow</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link href="#report">Report</Nav.Link>
            </Nav.Item>
          </Nav>
        </Card.Header>
        <Card.Body>
          <Card.Title>Special title treatment</Card.Title>
          <Card.Text>
            With supporting text below as a natural lead-in to additional content.
          </Card.Text>
          <Button variant="primary">Go somewhere</Button>
        </Card.Body>
      </Card>
      </Container>
    </>
  );
}
  
export default Extract;
